import { ReactComponent as LogoIcon } from './assets/logo.svg'

const Logo = ({className}) => {
  return (
    <button
      data-btn='root'
      className={`${className}__logo`}
    >
      <LogoIcon/>
    </button>
  )
}

export default Logo
